import React from 'react'
import App from '../App';
import '../style.css'

const AddAppliedJob = () => {
  return(
    <div className = "card text-white bg-warning mb-3" style = {{width:"100%"}}>
      <h5><label className = "card-header">Company Name: <input type = "text" className="form-control"></input></label></h5>
      <h6><label className = "card-title">Position: <input type = "text" className="form-control"></input></label></h6>
      <h7><label className = "card-text">Description: <input type = "text" className="form-control"></input></label></h7>
      <div>
        <button type="button" className="btn btn-success" style = {{margin: "5px", width: "30%"}}>Add job</button>
      </div>
    </div>
  );
}


export default AddAppliedJob
